//import logo from './logo.svg';
import './ExternalStylesheet.css';
import Song from './Song';
import Podcast from './Podcast';
import { Component } from 'react';
import AudioData from './audio.json'



class Playlist extends Component{
  render(){
    return(
      <div>
        {AudioData.map((audioDetail, index)=>{
          if(audioDetail.title)
            {
              //return <h1>{audioDetail.title}</h1>
              <Song songtitle={audioDetail.title} artist= {audioDetail.artist} year={audioDetail.year}/>
            }
          else
          {
            //return <h1>{audioDetail.episodeTitle}</h1>
            <Podcast season={audioDetail.season} episode= {audioDetail.episode} episodeTitle={audioDetail.episodeTitle}/>

          }


        })}
      </div>
    )
  }
}

export default Playlist
